import React from "react";
import background from './Utils/images/rename.jpg'

import "bootstrap/dist/css/bootstrap.min.css";
import { Col, Container, Row } from "react-bootstrap";
import Navi from "./components/Navi";

function App() {
  return (
    <Container style={{backgroundImage: `url${background}`}} fluid="true">
      <bg-image src={background}></bg-image>
      <Navi/>

    </Container>

  );
}

export default App;
